import React from 'react';
import './App.css';


function Items(){
  return (<div>  <Item type="About"/>   <Item type="Proyect"/>  <Item type="Contact"/> </div> );}


const Item = (props) => <a  href="hello"> {props.type}</a>;


function App() {
  return (
    <div className="App" >
       <nav>     <Items/>  </nav> 
    </div>
  );
}

export default App;
